import React, {useState, useEffect} from 'react';
import axios from 'axios';

const User = () => {

  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get("/user/list")
      .then((response) => {
        setLoading(false);
        console.log(response.data);
        setUsers(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  const Loading = () =>{
    return(
      <>
      <h1>Loading...</h1>
      </>
    )
  }

  const ShowUsers = () =>{
    return (
      <>
       {users.map(user =>{
         <p>{user}</p>
       })}
      </>
    )
  }

  return (
    <div>
        <h1>User List</h1>
        {loading ? <Loading /> : <ShowUsers />}
    </div>
  )
}

export default User
